import "./shoe-product.css";

function ShoeProduct({ imageUrl, name, price }) {
    return (
      <div className="shoe-product" onClick={() => handleProductClick()}>
        <img src={imageUrl} alt={name} />
        <div className="product-info">
          <div className="product-name">{name}</div>
          <div className="product-price">{price}</div>
        </div>
      </div>
    );
  }
  
  function handleProductClick() {
    // Handle the click event, e.g., navigate to a new page
  }
  
